import React, { Component } from "react";
import "./Mydata.css"
import axios from "axios";

class Mydata extends Component {
    constructor(props) {
        super(props);
        
        this.state = {
            useremail: localStorage.getItem("emailrip_app"),
            userpassword: "",
            userstatus: false,
            changedata:false,
            ovnerrip: {
                Number: 0,
                HometwoNumber: 0,
                LastName: "",
                Name: "",
                Pesel: 0,
                Street: "",
                city: "",
                email: "",
                ovner: "",
                _id: ""
            },
        }



    }

    componentDidMount = () => {

        axios.get(this.props.store.backendadress + '/userdb/userdata', { params: { id: localStorage.getItem('id') } })
            .then(res => {
                //   console.log(res.data);
                const email = res.data.email;
                const statususer = res.data.status;
                //console.log(statususer);
                this.setState({
                    useremail: email,
                    userpassword: res.data.password,
                    userstatus: statususer
                });

                if (statususer) {

                    //console.log("pobracovnerripa"+email)
                    axios.get(this.props.store.backendadress + '/ovnerrip/getdataovnerrip', { params: { email: email } })
                        .then(res => {
                            // console.log(res.data);

                            let ovner = res.data[0];
                            // console.log(ovner);
                            this.setState({ ovnerrip: ovner });

                        })


                }
            })
    }
    savedate=()=>{
        alert("is work");
    }
    handleChange=(name,value)=>{
        console.log(value);
        console.log(name);
        var field="";
        if(name!=="userpassword"){
            field="ovnerrip."+name;
        }else{
            field=name;
        }
       
        console.log(field);
        //na koniec 
        this.setState({changedata:true,
        })

    }
    validinput=()=>{

    }


    render() {
        const { useremail, userpassword, ovnerrip, userstatus,changedata} = this.state;
        

        return (
            <div className="userdatafield" key={178}>
                <div className="userdatacolumn" key={78}>
                    <div key={"781a"} className={"displeyrow"}>
                        <label className={"labeldata"} key={781}>Email:</label>
                        <input key={782} className="inputdatamydata" disabled="disabled" value={useremail} onChange={(e) => { this.handleChange(e.target.name, e.target.value) }} />
                    </div>
                    {userstatus ? [
                        <div key={"782a"} className={"displeyrow"}>
                            <label className={"labeldata"} key={783}>Imię:</label>
                            <input key={784} className="inputdatamydata" value={ovnerrip.Name || ''} onChange={(e) => { this.handleChange(e.target.name, e.target.value) }} />
                        </div>,
                        <div key={"782b"} className={"displeyrow"}>
                            <label className={"labeldata"} key={785}>Nazwisko:</label>
                            <input key={786} className="inputdatamydata" name="LastName"value={ovnerrip.LastName || ''} onChange={(e) => { this.handleChange(e.target.name, e.target.value) }} />
                        </div>,
                        <div key={"782c"} className={"displeyrow"}>
                            <label className={"labeldata"} key={787} >Pesel:</label>
                            <input key={788} className="inputdatamydata" disabled="disabled" value={ovnerrip.Pesel || ''} onChange={(e) => { this.handleChange(e.target.name, e.target.value) }} />
                        </div>,
                    ] : ['']}

                </div>
                <div className="userdatacolumn" key={79}>
                    <div key={"791a"} className={"displeyrow"}>
                        <label className={"labeldata"} key={791}>Hasło:</label>
                        <input key={792} className="inputdatamydata" value={userpassword || ''} onChange={(e) => { this.handleChange(e.target.name, e.target.value) }} />
                    </div>
                    {userstatus ? [
                        <div key={"793a"} className={"displeyrow"}>
                            <label className={"labeldata"} key={793}>Ulica:</label>
                            <input key={794} className="inputdatamydata" value={ovnerrip.Street || ''} onChange={(e) => { this.handleChange(e.target.name, e.target.value) }} />
                        </div>,
                        <div key={"794a"} className={"displeyrow"}>
                            <label className={"labeldata"} key={795}>Nr domu:</label>
                            <input key={796} className="inputdatamydata" value={ovnerrip.HomeNumber || ''} onChange={(e) => { this.handleChange(e.target.name, e.target.value) }} />
                        </div>,
                        <div key={"795a"} className={"displeyrow"}>
                            <label className={"labeldata"} key={797}>Nr mieszkania:</label>
                            <input key={798} className="inputdatamydata" value={ovnerrip.HometwoNumber || ''} onChange={(e) => { this.handleChange(e.target.name, e.target.value) }} />
                        </div>,
                        <div key={"796a"} className={"displeyrow"}>
                            <label className={"labeldata"} key={799}>Miasto:</label>
                            <input key={7910} className="inputdatamydata" value={ovnerrip.city || ''} onChange={(e) => { this.handleChange(e.target.name, e.target.value) }} />
                        </div>,

                    ] : [""]}
                    {changedata?<button className={"buttonsavechange"} key={"butonsavechange"}>Zapisz zmiany</button>:""}
                </div>





            </div>
        )


    }

}

export default Mydata
